import { Button, SafeAreaView, StyleSheet, Text, TextInput, View } from 'react-native';

import { StatusBar } from 'expo-status-bar';

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.inputContainer}>
        <TextInput placeholderTextColor='#364958' placeholder='add item'/>
        <Button title='Add' color='#3b60641' />
      </View>
      <View>
        <Text>Lista</Text>
      </View>      
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#55828b',
  },
  inputContainer: {
    flexDirection: 'row',
    paddingVertical: 30,
    paddingHorizontal: 20,
    alignItems: 'center',    
  },
  input: {
    borderBottomWidth: 1,
    paddingVertical: 10,
    borderBottomColor: '#7D8CC4',
    marginVertical: 20,
  }
});
